/*Table structure for table `node` */

DROP TABLE IF EXISTS `node`;

CREATE TABLE `node` (
  `node_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '节点ID',
  `relevance_id` int(11) DEFAULT NULL COMMENT '关联ID',
  `harness_configuration_id` int(11) DEFAULT NULL COMMENT '线束段配置ID',
  `tx_id` varchar(20) NOT NULL COMMENT '发送ID',
  `rx_id` varchar(20) NOT NULL COMMENT '接收ID',
  PRIMARY KEY (`node_id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

