insert  into `notice`(`notice_id`,`admin_id`,`notice_name`,`notice_describe`,`release_time`,`visitor_volume`) values (1,1,'各模块网络管理帧（Network management message of each module）','每个模块都有网络管理报文，模块在被本地事件唤醒后会不断周期性发送网络管理报文（Each module has a network management message, which will be sent periodically after being awakened by local events）','2019-11-28 00:00:00',0),(2,1,'网关映射教程（Gateway mapping tutorial）','通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具体方法。通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具体方法。通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具体方法。通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具体方法。通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具体方法。通常带网关的车型，OBD口接上设备只能看到6和14帧脚所接的一路CAN（P CAN或者E CAN），附件是V SPY工具将其他路CAN的报文通过网关映射出来的具','2019-07-08 00:00:00',0),(3,1,'电池包加热验证','此流程是产线检测电池包加热功能的具体指令，包括转换成具体的诊断指令的流程，供新能源BMS组同事阅读！','2019-06-29 00:00:00',0),(4,1,'从报文解析故障码信息（Parse DTC from message）','诊断响应的报文不能直观的看出故障码，也无法判断故障码是当前还是历史故障，此文档为大家做出了详细说明。\nThe diagnosis response message cannot intuitively see the fault code, nor can it determine whether the fault code is the current or historical fault.','2019-07-04 00:00:00',0),(5,1,'IMMO返修提示（IMMO repair tips）','此文档包含IMMO车型各Routine ID响应的详细内容\nThis document contains details of the various Routine ID responses of the IMMO models','2019-07-04 00:00:00',0),(6,1,'3C1 3C9防盗策略（Security authentication method）','针对机械钥匙车型和PEPS车型，总结了各自情况下的3C1  3C9防盗认证策略\n\nAccording to mechanical key vehicle type and PEPS vehicle type, the security authentication strategies of 3C1 3C9 under their own circumstances are summarized','2019-07-11 00:00:00',0),(7,1,'项目造车固定VIN PIN ESK(Fixed ESK and PIN used in the project car construction)','项目造车期间，为方便匹配防盗，使用了固定的PIN码及ESK，见附件(During the construction of the project, fixed PIN code and ESK were used to facilitate the match against theft. Please refer to the attachment)','2020-07-27 00:00:00',0),(8,1,'诊断小助手APP使用说明','诊断小助手APP使用说明','2020-07-27 00:00:00',0),(9,1,'125','125','2020-08-05 08:56:58',0),(16,1,'15','15','2020-08-06 15:42:46',0),(17,1,'测试0806','测试','2020-08-06 15:59:39',0),(20,1,'15','15','2020-08-10 16:59:20',0),(25,1,'11','11','2020-08-13 09:27:57',0),(26,1,'111','111','2020-08-13 09:35:24',0),(27,1,'诊断小助手APP使用说明','每个模块都有网络管理报文，模块在被本地事件唤醒后会不断周期性发送网络管理报文（Each module has a network management message, which will be sent periodically after being awakened by local events）','2020-08-14 15:05:26',0);

