insert  into `version`(`version_id`,`version_number`,`version_title`,`version_content`,`apk_url`,`creation_date`,`is_force`) values (1,2,'1.1','修复已知bug','fileDir/apk/20200821wda.apk','2020-08-17 00:00:00','\0'),(4,3,'1.2','更新远程操作功能，目前只能点击！','fileDir/apk/20200904151517wda.apk','2020-09-04 15:15:24','\0'),(6,4,'1.3','1、更新app配置热点信息并连接VCI。\n2、实现总线监听功能。\n3、优化远程协助。','fileDir/apk/20200907152023wda.apk','2020-09-07 15:21:39',''),(8,5,'1.4','更新：1.TF卡信息查询，筛选和导出。2.总线监听软触发录制','fileDir/apk/20200914162924wda.apk','2020-09-14 16:29:27','\0'),(12,7,'1.6','连接：<br/>\n1.优化了与VCI之间的连接<br/>\n2.新增VCI建立连接时蜂鸣提示<br/>\n<br/>\n总线监听<br/>\n1.【记录】按钮重命名为【软触发】<br/>\n2.初步完成软触发指令发送，可配置保留出发点前报文条数和存储时间<br/>\n3.点击【总线监听】中【时间(s)】标题栏可对时间显示进行切换<br/>\n<br/>\nTF卡录制<br/>\n1.修复了【TF卡应用】模块无法读取VCI文件列表以及导出的bug<br/>\n2.【TF卡应用】模块中导出功能可通过输入can通道或者时间进行筛选<br/>','fileDir/apk/20200916161240wda.apk','2020-09-16 16:13:01','\0'),(13,8,'1.7','1：APP整体布局优化<br/>\n2：优化VCI与APP的连接速度<br/>\n3：优化TF应用中导出功能<br/>\n4：总线监听新增报文暂停/开始键<br/>','fileDir/apk/20200917152826wda.apk','2020-09-17 15:28:47','\0'),(14,9,'1.8','1.解决了导出VCI文件时闪退的问题<br/>\n2.新增远程协助来电提示音<br/>','fileDir/apk/20200918105830wda.apk','2020-09-18 10:59:35','\0'),(15,10,'1.9','1.重写APP与VCI的连接，连接更稳定。<br/>\n2.重写【总线监听】报文解析，支持多帧报文。<br/>\n3.完成软触发导出功能。<br/>\n4.新增连接VCI显示提示，在侧边栏【连接VCI】可查看VCI的连接状态。<br/>\n<br/>\n小提示：在使用【连接VCI】模块时，将移动网络关掉配置会更快更稳定哦~ <br/>','fileDir/apk/20200923152512wda.apk','2020-09-23 15:25:53','\0'),(16,11,'2.0','1、永久触发和软触发默认的分开录改成录在一个文件。','fileDir/apk/20200924152950wda.apk','2020-09-24 15:30:24','\0'),(17,12,'2.1','更新了映射功能','fileDir/apk/20200925113124wda.apk','2020-09-25 11:31:35','\0'),(18,13,'2.2','1、解决连接VCI闪退问题。','fileDir/apk/20200925121627wda.apk','2020-09-25 12:17:18',''),(19,14,'2.3','1.重新定义映射规则<br/>\n2.重新定义TF卡文件导出规则<br/>\n3.修复【永久触发】选择通道参数不对应的问题<br/>','fileDir/apk/20200927110400wda.apk','2020-09-27 11:04:30','\0'),(20,15,'2.4','改写了映射规则','fileDir/apk/20200928084325wda.apk','2020-09-28 08:43:48','\0'),(21,16,'2.5','1.修复映射模块部分Bug<br/>\n2.修改永久触发部分参数不正确的问题<br/>','fileDir/apk/20200928112533wda.apk','2020-09-28 11:26:53','\0'),(22,17,'2.6','改写了映射规则','fileDir/apk/20200928154550wda.apk','2020-09-28 15:46:08','\0'),(23,18,'2.7','优化使用映射功能闪退问题','fileDir/apk/20200928164332wda.apk','2020-09-28 16:43:46','\0'),(24,19,'2.8','1.改写映射规则   <br/>\n2.TF卡内容导出目录变更：<br/>\n  1).导出的原文件（bin）保存于【本地存储目录/com.gx.wda/export_msg_info/bin/】目录下  <br/>\n  2).导出的解析文件（asc）保存于【本地存储目录/com.gx.wda/export_msg_info/asc/】目录下  <br/>','fileDir/apk/20200929081129wda.apk','2020-09-29 08:11:31','\0'),(25,20,'2.9','修复映射无响应的问题','fileDir/apk/20200929085027wda.apk','2020-09-29 08:50:55','\0'),(26,21,'3.0','增加了一个报文日志，麻烦注意看一下日志中报文发送接收走到哪一步了，方便报错分析','fileDir/apk/20200929093241wda.apk','2020-09-29 09:32:48','\0'),(27,22,'3.1','修复临时映射闪退问题','fileDir/apk/20200929103734wda.apk','2020-09-29 10:37:38','\0'),(28,23,'3.2','重新定义映射报文','fileDir/apk/20200929111025wda.apk','2020-09-29 11:10:26','\0'),(29,24,'3.3','重新定义映射模块错误帧报文','fileDir/apk/20200929112709wda.apk','2020-09-29 11:30:19','\0'),(30,25,'3.4','重新定义映射模块部分报文，已经优化部分bug\n ','fileDir/apk/20200929150159wda.apk','2020-09-29 15:02:03','\0'),(31,26,'3.5','优化映射模块','fileDir/apk/20200929154139wda.apk','2020-09-29 15:41:41','\0'),(32,27,'3.6','再测一下','fileDir/apk/20200929161556wda.apk','2020-09-29 16:16:08','\0'),(33,28,'3.7','优化映射指令重发发送的问题','fileDir/apk/20200929164525wda.apk','2020-09-29 16:45:28','\0'),(34,29,'3.8','优化临时映射成功闪退问题','fileDir/apk/20200929170954wda.apk','2020-09-29 17:10:02','\0'),(35,30,'3.9','优化了映射闪退的问题','fileDir/apk/20200929172539wda.apk','2020-09-29 17:25:53','\0'),(37,31,'4.0','测试','fileDir/apk/20200930141722wda.apk','2020-09-30 14:17:28','\0'),(38,32,'4.1','更改asc文件','fileDir/apk/20200930160842wda.apk','2020-09-30 16:08:46','\0'),(39,33,'4.2','测试闪退版本','fileDir/apk/20200930162606wda.apk','2020-09-30 16:26:14','\0'),(40,34,'4.3','测试映射','fileDir/apk/20200930174103wda.apk','2020-09-30 17:41:06','\0'),(41,35,'4.4','改写网关映射规则','fileDir/apk/20200930175809wda.apk','2020-09-30 17:58:13','\0'),(42,36,'4.5','1、【连接VCI】VCI重置时间由20s改为10s。<br/><br/>\n2、【总线监听】优化报文显示，但是目前还未实现【筛选】、【时间切换】以及【报文计数】。<br/><br/>\n3、【TF应用】 新增【清空TF卡数据】功能。<br/>\n 导出TF卡文件时新增导出询问提示。<br/>\n','fileDir/apk/20201012195601wda.apk','2020-10-12 20:02:18','\0'),(43,37,'4.6','1、【总线监听】还原原有的功能<br/>\n2、【TF应用】导出优化<br/>\n3、修复部分BUG','fileDir/apk/20201014165623wda.apk','2020-10-14 16:57:47','\0'),(44,38,'4.7','1、修复部分机型无法显示系统通知栏的bug。<br/>\n2、导出asc文件数据场使用空格隔开，报文时间戳重新解析。','fileDir/apk/20201016155441wda.apk','2020-10-16 15:54:50','\0'),(45,39,'4.7.1','1、永久触发/软触发的默认监听时间由原来5分钟改成3分钟<br/>\n2、TF卡配置页面上设置好的数据在下一次进来时会回填<br/>\n3、修复导出asc文件部分bug','fileDir/apk/20201020191347wda.apk','2020-10-20 19:13:50','\0'),(46,40,'4.7.2','1、重做与VCI的连接方式，连接更快捷更稳定。<br/>\n2、配置连接VCI新增是用哪个状态判断。<br/>\n3、修复部分bug','fileDir/apk/20201029103305wda.apk','2020-10-29 10:34:43','\0'),(47,41,'4.7.3','1、总线监听【启动】按钮改为不自动开启。<br/>\n2、映射增加对67 01 00 00 00 00响应判断','fileDir/apk/20201103081709wda.apk','2020-11-03 08:18:13','\0'),(48,42,'4.7.4','优化了映射模块','fileDir/apk/20201106164650wda.apk','2020-11-06 16:47:25','\0');

